import React, { useState } from 'react';

function Fortest1(props) {
  const [fruitList, setFruitList] = useState([
    '사과',
    '배',
    '포도',
    '수박',
    '머루',
  ]);
  return (
    <div>
      <ul>
        {fruitList.map((item, index) => {
          return <div key={index}>{item}</div>;
        })}
      </ul>
    </div>
  );
}

export default Fortest1;
